import React, { Component } from 'react';
import classNames from 'classnames';
import {AppBar,MuiThemeProvider ,TextField,RaisedButton} from 'material-ui';
import Card from '@material-ui/core/Card';
import { withStyles } from '@material-ui/core/styles';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import MenuItem from '@material-ui/core/MenuItem';
import InputAdornment from '@material-ui/core/InputAdornment';

const styles = theme => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  margin: {
    margin: theme.spacing.unit,
  },
  withoutLabel: {
    marginTop: theme.spacing.unit * 3,
  },
  textField: {
    flexBasis: 200,
  },
  card: {
    maxWidth: 445,
  },
  button : {
    margin : 15
  }
});

const whenDD = [
  {
    value: 'NOW',
    label: 'NOW',
  },
  {
    value: 'LATER',
    label: 'DELIVER LATER',
  },
];
class RideDetails extends Component {
  
    continue = e => {
        e.preventDefault();
        this.props.nextStep();
    }

    render() {
        const { classes,handleChange,values} = this.props; 
        return ( 
          <div>
            <Card className={classes.card + " card "}>
            <CardContent >
              <Typography gutterBottom variant="h5" component="h2" className={"typography"}>
                  Make Delivery Easy
              </Typography>
              <Typography component="p" className="typography1">
                  Assign delivery to us sit back and relax.
              </Typography>
            </CardContent>
            <MuiThemeProvider>
                    <React.Fragment>
                    <TextField
                      className={classNames(classes.margin, classes.textField) + " fields "}
                      hintText = "Enter The Pick up Location"
                      floatingLabelText="Pick up"
                      onChange = {handleChange('pickup')}
                      />
                    <br/>
                      <TextField
                      id="drop-location"
                      className={classNames(classes.margin, classes.textField) + " fields "}
                      hintText = "Enter The Drop Location"
                      floatingLabelText="Drop"
                      onChange = {handleChange('drop')}
                      />
                      <br/>
                      <TextField
                      select
                      className={classNames(classes.margin, classes.textField) + " fields "}
                      value={values.when}
                      InputProps={{
                          startAdornment: <InputAdornment position="start">WHEN</InputAdornment>,
                      }}
                      onChange = {handleChange('when')}
                      >
                      {/* {whenDD.map(option => (
                          <MenuItem key={option.value} value={option.value}>
                          {option.label}
                          </MenuItem>
                      ))} */}
                      </TextField>
                      <CardActions>
                          <Button size="small" color="primary" className="button-lg" 
                            onClick = {this.continue}>
                              FIND NOW
                          </Button>
                      </CardActions>
                    </React.Fragment>
                    {/* <input type="text" values = {values.firstName} onChange ={handleChange('firstName')}/> */}
                </MuiThemeProvider>                  
            </Card>
          
          </div>
          
        );

    }
}
export default withStyles(styles)(RideDetails);
